from unittest import TestCase, main
from jump_game import Solution

s = Solution()


class TestSuite(TestCase):
    def test_1(self):
        nums = [2, 3, 1, 1, 4]
        self.assertTrue(s.canJump(nums))

    def test_2(self):
        nums = [3, 2, 1, 0, 4]
        self.assertFalse(s.canJump(nums))

    def test_3(self):
        nums = [0]
        self.assertTrue(s.canJump(nums))

    def test_4(self):
        nums = [0, 2, 3]
        self.assertFalse(s.canJump(nums))

